package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_RTK_BASELINE_COORDINATE_SYSTEM(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e RTK_BASELINE_COORDINATE_SYSTEM
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := RTK_BASELINE_COORDINATE_SYSTEM_ECEF.MarshalText()
		require.NoError(t, err)

		var dec RTK_BASELINE_COORDINATE_SYSTEM
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, RTK_BASELINE_COORDINATE_SYSTEM_ECEF, dec)
	})
}
